script: |
  super -f text -I q12690.spq | sort > q12690.out

inputs:
  - name: q12690.spq
    data: |
      SELECT col1 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN + - col2 * - col1 AND ( - col0 * col1 * + + 67 - + col0 * + - col1 * - - col2 );
  - name: tab2

outputs:
  - name: q12690.out
    data: |
